import React, { useState, useEffect } from 'react';
import mercedes from './Medicines'
import OurCard from './Card'
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import { IconCount } from './data'
const useStyles = makeStyles(() => ({

    paper: {
        height: 140,
        width: 100,
    },

}));
export default function Mercedes(props) {



    const dataChange = () => {
        const [product, setProduct] = useState({})
        setProduct({ product: props, onChange: dataChange })
        console.log(product)
    }
    useEffect(() => {
        dataChange()
    }, [])
    const classes = useStyles();
    return (
        <div>
            <IconCount.Provider value={product}>
                <Grid container justify="center">
                    {props.ndata.map((value) => (
                        <Grid key={value} >
                            <OurCard className={classes.paper} value={value} />
                        </Grid>
                    ))}
                </Grid>
            </IconCount.Provider>
        </div>

    )
}
